export default {
	shipmentItemReceiveType: () => {
		var item = QueryMaterialInventoryHandling.data.data.getMaterialDefinition
		//return item
		return (item.inventoryHandlingPolicy.trackBySerialNumber ? 'SERIALISED':item.inventoryHandlingPolicy.trackByCarrier ? 'CARRIER':'BULK');
	},
	getQuantity: () => {
		var item = QueryMaterialInventoryHandling.data.data.getMaterialDefinition
		//return item
		return (item.inventoryHandlingPolicy.trackBySerialNumber ? 1:item.inventoryHandlingPolicy.trackByCarrier ? _.int(inputCarrierQuantity.text) : _.int(inputBulkQuantity.text));
	}
}
